var $bm_rt;
var ctrl = null;
var result = value;
try {
    ctrl = effect('IK')(1);
} catch (e) {
    value;
}
;
if (ctrl != null) {
    var goal = ctrl.effect('IK | Feast')(1).value;
    result = $bm_sum(result, ctrl.rotation.value);
    if (goal) {
        var layer = thisLayer;
        while (layer.hasParent) {
            layer = layer.parent;
            result = $bm_sub(result, layer.rotation);
        }
    }
}
$bm_rt = result;

var $bm_rt;
var W, FK, R;
var ctrl = null;
var result = value;
try {
    ctrl = effect('IK')(1);
} catch (e) {
    value;
}
;
if (ctrl != null) {
    var C = ctrl.toWorld(ctrl.anchorPoint);
    var O = thisLayer.toWorld(thisLayer.anchorPoint);
    var fx = ctrl.effect('IK | Feast');
    W = $bm_div(fx(2).value, 100);
    FK = fx(3).value;
    R = fx(6).value;
    var useIK = fx(1).value;
    var parentRot = fx(5).value;
    result = $bm_sum(value, FK);
    if (useIK) {
        var vec = R == 1 ? $bm_sub(O, C) : $bm_sub(C, O);
        var layer = thisLayer;
        if (layer.hasParent && parentRot)
            result = $bm_sum(result, layer.parent.rotation.value);
        while (layer.hasParent) {
            layer = layer.parent;
            result = $bm_sub(result, layer.rotation);
        }
        var angle = Math.atan2(vec[1], vec[0]);
        angle = radiansToDegrees(angle);
        angle = $bm_mul(angle, W);
        result = $bm_sum(result, angle);
    }
}
$bm_rt = result;
